import React, { useState } from 'react';
import Post from './Post';
import { Pagination } from 'react-bootstrap';
import UpdateField from './Field';

function Feed() {
    const [currentPage, setCurrentPage] = useState(1);
    const postsPerPage = 20;
    const posts = [
        { user: 'Alex', content: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.' },
        { user: 'user2', content: 'Post 2' },
        { user: 'user3', content: 'Post 3' },
        { user: 'user4', content: 'Post 4' },
        { user: 'user5', content: 'Post 5' },
        { user: 'user6', content: 'Post 6' },
        { user: 'user7', content: 'Post 7' },
        { user: 'user8', content: 'Post 8' },
        { user: 'user9', content: 'Post 9' },
        { user: 'user10', content: 'Post 10' },
        { user: 'user11', content: 'Post 11' },
        { user: 'user12', content: 'Post 12' },
        { user: 'user13', content: 'Post 13' },
        { user: 'user14', content: 'Post 14' },
        { user: 'user15', content: 'Post 15' },
        { user: 'user16', content: 'Post 16' },
        { user: 'user17', content: 'Post 17' },
        { user: 'user18', content: 'Post 18' },
        { user: 'user19', content: 'Post 19' },
        { user: 'user20', content: 'Post 20' },
        { user: 'user1', content: 'Post 1' },
        { user: 'user2', content: 'Post 2' },
        { user: 'user3', content: 'Post 3' },
        { user: 'user4', content: 'Post 4' },
        { user: 'user5', content: 'Post 5' },
        { user: 'user6', content: 'Post 6' },
        { user: 'user7', content: 'Post 7' },
        { user: 'user8', content: 'Post 8' },
        { user: 'user9', content: 'Post 9' },
        { user: 'user10', content: 'Post 10' },
        { user: 'user11', content: 'Post 11' },
        { user: 'user12', content: 'Post 12' },
        { user: 'user13', content: 'Post 13' },
        { user: 'user14', content: 'Post 14' },
        { user: 'user15', content: 'Post 15' },
        { user: 'user16', content: 'Post 16' },
        { user: 'user17', content: 'Post 17' },
        { user: 'user18', content: 'Post 18' },
        { user: 'user19', content: 'Post 19' },
        { user: 'user20', content: 'Post 20' },
    ];
  // Get current posts
  const indexOfLastPost = currentPage * postsPerPage;
  const indexOfFirstPost = indexOfLastPost - postsPerPage;
  const currentPosts = posts.slice(indexOfFirstPost, indexOfLastPost);

  // Change page
  const paginate = (pageNumber) => setCurrentPage(pageNumber);

  // Build pagination items
  const pageItems = [];
  for (let i = 1; i <= Math.ceil(posts.length / postsPerPage); i++) {
    pageItems.push(
      <Pagination.Item key={i} active={i === currentPage} onClick={() => paginate(i)}>
        {i}
      </Pagination.Item>
    );
  }
  return (
    <div>
        <div style={{ margin: '0 auto', width: '50%' }}>
            <UpdateField/>
            {currentPosts.map((post, index) => (
                <Post key={index} user={post.user} content={post.content} />
            ))}
        <Pagination>{pageItems}</Pagination>
        </div>
    </div>
  );
}

export default Feed;
